window.bookSummaryJSON = "<p>Mirror World is stirring, about to embrace the new global changes of its map. </p> <p>Everyone is getting ready to colonize No-Man's Lands. The strongest clans send their best fighters on recon missions, impatient to make stakes for the juiciest locations. </p> <p>Market prices have taken to the sky like flocks of scared pigeons. New alliances are struck while mercenaries upgrade their armor and grind edges on their swords. Their time is looming. </p> <p>A war is coming to Mirror World. </p> <p>Olgerd, too, is getting ready, a new goal already in his sights. The ancient Ennan City awaits him. </p> <p>All he needs to do now is gain some strength. </p>"; 
